import React from 'react';
import "../Asserts/Css/Pages/Home.css";
import IIEC_logo from "../Asserts/images/IIEC_logo.png";
import map from "../Asserts/images/Map.png";
import Header from '../Components/header';
import Footer from '../Components/footer';
import StudyAbroad from '../Components/StudyAbroad';
import studyabroadintakesfull from '../Asserts/images/studyabroadintakesfull.png';
import mainpanelfull from '../Asserts/images/mainpanelfull.png';
import studyabroaadpanel from '../Asserts/images/studyabroaadpanel.png';
// import studyabroadintakesfull from '../Asserts/images/studyabroadintakesfull.png';
// import studyabroadintakesfull from '../Asserts/images/studyabroadintakesfull.png';


const Home =()=>{
   return (
       <div className='homepage'>
       <Header></Header>
       
           <img className='mapimage' src={map}></img>
          
          <div className='homestudyabroad'><StudyAbroad></StudyAbroad></div>
          <div className='studyabroadintakes'>
              <img className='imgstudyabroad' src={studyabroadintakesfull}></img>
              <p></p>

          </div>

          <img  src={mainpanelfull}></img>
          <img src={studyabroaadpanel}></img>
          {/* <img src={}></img>
          <img src={}></img>
          <img src={}></img>
          <img src={}></img>
          <img src={}></img> */}
       
      
         <div className='homefooter'><Footer></Footer></div>
         </div>
   )}
export default Home ;
